import React from "react";


const Recipe= ({id, name,diets,image, summary})=>{
    

    return (
        <div>
            {
                id === "string" ? 
                    <ul>
                        <p>{name}</p>
                        <img src={image} alt="recipe" />
                        <p>{summary}</p>
                        {/* <p>{diets.map(d=> <li>{d.name}</li>)}</p> */}
                    </ul> 
                :
                <ul>
                    {/* <p>{name}</p>
                    <img src={image} alt="recipe"/> */}
                    <p>{diets}</p>

                </ul>
            }

        </div>
    )
}   

export default Recipe;
